import React from 'react';

import {
	Nav,
	Image
} from 'react-bootstrap';

export default class Footer extends React.Component {

	render() {
        const navLinks = this.props.nav;
        return (
            <footer className="text-white-50 text-right mr-3 sticky-bottom">
                <Nav className="justify-content-end">
                    <p className="mt-auto mb-auto">©2019, Daniel Ramírez</p>
                    { navLinks && navLinks.map((value, index) => { return (
                        <Nav.Link className="nav-link text-right align-self-end m-0 justify-content-end" href={value.href} alt={value.item} target="_blank" >
                            <Image src={value.icon} height={25} className="p-0" ></Image>
                        </Nav.Link>
                    )})}
                </Nav>
            </footer>
        )
