						</Row>
					</Navbar.Brand>
					<Navbar.Toggle aria-controls="basic-navbar-nav" />
					<Navbar.Collapse className="justify-content-end">
						<Nav>
							{ navLinks && navLinks.map((value, index) => { return (
								<Nav.Link key={index} className="nav-link text-right" href={value.href} >{value.item}</Nav.Link>
							)})}
						</Nav>
					</Navbar.Collapse>
				</Navbar>
			</header>
		)*/
	}
}
